INSERT INTO nameTable (id,item) VALUES (22410,"Moi aussi.");
INSERT INTO nameTable (id,item) VALUES (22411,"Ah, super! Tu es français?");
INSERT INTO nameTable (id,item) VALUES (22412,"Non, je suis canadien. Et mes parents sont espagols.");
INSERT INTO nameTable (id,item) VALUES (22413,"J\'aime beaucoup l\'Espagne! Tu as un animal de compagie?");
INSERT INTO nameTable (id,item) VALUES (22414,"Oui, j\'ai deux chats et un chien.");
INSERT INTO nameTable (id,item) VALUES (22415,"Oh, super, Sébastien! J\'ai aussin un chien!");
