INSERT INTO nameTable (id,item) VALUES (22419,"Salut! Tu es Paul? Je suis Anne.");
INSERT INTO nameTable (id,item) VALUES (22420,"Euh... Non... Je m\'appelle Sébastien.");
INSERT INTO nameTable (id,item) VALUES (22421,"Composé");
INSERT INTO nameTable (id,item) VALUES (22422,"Bonjour, Priti!");
INSERT INTO nameTable (id,item) VALUES (22423,"Salut, mon chéri... Oú sont mes clés?");
