INSERT INTO nameTable (id,item) VALUES (22430,"Le café est prêt!");
INSERT INTO nameTable (id,item) VALUES (22431,"Où est le sucre? Ah, il est ici.");
INSERT INTO nameTable (id,item) VALUES (22432,"Elle boit son café.");
