INSERT INTO nameTable (id,item) VALUES (22438,"David a un appel vidéo avec un nouveau partenaire de langue pour pratiquer un peu la langue avant son voyage");
INSERT INTO nameTable (id,item) VALUES (22439,"Alex. Salut David! Ravi de faire ta connaissance!");
INSERT INTO nameTable (id,item) VALUES (22440,"David. Salut Alex, ravi de faire ta connaissance également!");
INSERT INTO nameTable (id,item) VALUES (22441,"David. Je ne parle pas français mais j\'\'apprends!\'");
