INSERT INTO nameTable (id,item) VALUES (22443,"Alex. Quel âge as-tu?");
INSERT INTO nameTable (id,item) VALUES (22444,"David. J\'ai 30 ans");
INSERT INTO nameTable (id,item) VALUES (22445,"David. Oú habites-tu?");
INSERT INTO nameTable (id,item) VALUES (22446,"Alex. Je vis à Paris");
INSERT INTO nameTable (id,item) VALUES (22447,"David. Génial!");
INSERT INTO nameTable (id,item) VALUES (22448,"David. Ça a toujours été mon rêve de visiter ta ville");
INSERT INTO nameTable (id,item) VALUES (22449,"David. Je veux en apprendre plus à ce sujet");
INSERT INTO nameTable (id,item) VALUES (22450,"Alex. C\'\'est un endroit très excitant avec beaucoup de choses à voir et à faire.");
INSERT INTO nameTable (id,item) VALUES (22451,"David. Ça a l\'\'air super. Je veux absolument y aller");
INSERT INTO nameTable (id,item) VALUES (22452,"David. Mais d\'\'abord, je veux parler couramment");
INSERT INTO nameTable (id,item) VALUES (22453,"Alex. Je suis là pour t\'\'aider, ne t\'\'inquiète pas");
INSERT INTO nameTable (id,item) VALUES (22454,"Alex. Qu\'\'est-ce que tu fais dans la vie?");
INSERT INTO nameTable (id,item) VALUES (22455,"David. Je suis étudiant en histoire");
INSERT INTO nameTable (id,item) VALUES (22456,"David. Et toi? Tu fais quoi dans la vie");
INSERT INTO nameTable (id,item) VALUES (22457,"Alex. J\'\'enseigne les maths à l\'\'école");
INSERT INTO nameTable (id,item) VALUES (22458,"David. Oh, c\'\'est super cool. Écoute, je dois y aller");
INSERT INTO nameTable (id,item) VALUES (22459,"David. On se reparle bientôt, d\'\'accord");
INSERT INTO nameTable (id,item) VALUES (22460,"Alex. Ok. À la prochaine");
